    <div>
        <h1>POST API Method</h1>
        <textarea placeholder='Title' value={title} onChange={(e) => setTitle(e.target.val)}/>
        <br/><br/>
        <textarea placeholder='Body' value={body}/>
        <br/><br/>
        <button>Submit</button>
    </div>
  )
}

export default PostAPI
